import{a as t,b as e,o as a,e as s}from"./entry.048925a3.js";const i={},o={class:"bottom-hue"},c=s('<div class="min-h-screen h-full px-10 pb-10 font-mono text-slate-800 text-center hue" data-v-06ff9698><div class="w-9/12 mx-auto" data-v-06ff9698><p class="text-7xl font-bold pt-48" data-v-06ff9698>Competition and Ecological Niches</p><p class="text-xl mt-4" data-v-06ff9698>Interspecific competition is competition over a certain resource (often food) that forces organisms into niches</p><p class="text-3xl mt-8 font-semibold" data-v-06ff9698>What is a Niche?</p><div class="flex flex-row shadow rounded-lg bg-white" data-v-06ff9698><div class="flex flex-col w-3/12" data-v-06ff9698><img src="http://homesfeed.com/wp-content/uploads/2015/08/Huge-single-wall-niche.jpg" class="rounded-lg" data-v-06ff9698></div><div class="flex flex-col w-9/12 p-8" data-v-06ff9698><div class="flex flex-row text-lg font-semibold" data-v-06ff9698> What is a Niche? </div><div class="flex flex-row text-md caption" data-v-06ff9698> An ecological niche is the role and position a species has in its environment. ie. what it eats, what eats it, and how it behaves. Two organisms cannot occupy the same niche because they will compete for the same resources and one will eventually die out. </div></div></div><p class="text-3xl mt-8" data-v-06ff9698>Ecological Niche</p><div class="text-left" data-v-06ff9698><p class="text-md mt-2" data-v-06ff9698>When two organisms fight for the same limited food source, if one has even a slight reproductive edge, it will kill out the other species.</p><p class="text-lg text-center mt-1" data-v-06ff9698>Possible Niches Include</p><p class="text-md mt-1" data-v-06ff9698>- Time (nocturnal / diurnal)</p><p class="text-md mt-1" data-v-06ff9698>- Place (higher up / lower down)</p><p class="text-lg text-center mt-1" data-v-06ff9698>Fundamental Niche</p><p class="text-md mt-1" data-v-06ff9698>Fundamental niche is the niche is the niche that an animal would occupy without any competition (what it is made to do)</p><p class="text-lg text-center mt-1" data-v-06ff9698>Realized Niche</p><p class="text-md mt-1" data-v-06ff9698>Realized niche is the niche that the organism actually occupies due to competition or other factors</p></div><p class="text-3xl mt-8" data-v-06ff9698>Character Displacement</p><p class="text-md mt-2" data-v-06ff9698>Character displacement is the phenomenon that species separated can be mores similar than overlapping species</p><p id="foodCount" data-v-06ff9698>Food: 100</p><p id="deerCount" data-v-06ff9698>Deer: 0</p><canvas id="canvas" width="600" height="600" style="border-color:black;border-width:1px;border-style:solid;" data-v-06ff9698></canvas></div></div>',1),d=[c];function l(n,f){return a(),e("div",o,d)}const h=t(i,[["render",l],["__scopeId","data-v-06ff9698"]]);export{h as default};
